import { withAppSyncData } from 'next-apollo-appsync'
import awsConfig from '../pages/aws-exports';

const config = {
    url: awsConfig.aws_appsync_graphqlEndpoint,
    region: awsConfig.aws_appsync_region,
    auth: {
        type: awsConfig.aws_appsync_authenticationType,
        jwtToken: 'eyJraWQiOiJQckxaZTNNTVVmNE5aSFQ5Rk95UVwvdTR2cFFvbmxTQXFLd1FlSHNFcDgrRT0iLCJhbGciOiJSUzI1NiJ9..Cplk1-G-j_INgRGjEwJjX-Yk9LQtWaQl6nLrQ4_LwWdjFqxmpDxalnnihAsBAMS1DcFySfkyoLsFo9GLqzgJaJf7RfdzsPpSqoWiL1jXNKshwktBWJrenEnbs8vfKHv8R-iYF3u7ZRVoN8awks_mghF1eOoJnhb7JIGx5ealKTQwx5znhQDtL2Vj-PceUS-F7mmpqJYsFDkCOg1Jnx_czRbuQ0gcNVjoHIZRVbvwD7Qulwd4MCbR8RLW3Zi7BHpcWb1FqGcCuZS2aqj3vV5xOE9T2TvJuruYSXeHht4VbjQn3Oj7Xa5D189INx3TLXIwMsO3A0SBO4gQyh6-blx56g'
    },
}

export default withAppSyncData(config);
